import React from 'react';
import './About.css';

const About = () => (
    <div className="about">
        <h2>What is GownCorner by GDL?</h2>
        <p>Officially launched in 2024, GownCorner by GDL is an online gown hire store for all occasions...</p>
    </div>
);

export default About;
